import React, {Component} from 'react'
import List from './List'
import Title from './Title'

class Main extends Component {
    render() {
        return (
            <div>
                <Title  title={'Todos'}/>
                <List tasks={['Get up early in the morning', 'Go to Gym']} />
                <List tasks={['Start your day', 'Go to work']} />
            </div>
        );
    }
}

export default Main
